const Index = () => {

  return (
    <main>
      <div id="header">
        <div id="logo">logo</div>
        <div id="header-tel" class="tel">tel</div>
        <div id="header-mail" class="mail">mail</div>
      </div>
      <div id="navbar">navbar</div>
      <div id="carroussel">carroussel</div>
      <div id="presentation">presentation</div>
      <div id="localization">localization</div>
      <div id="keys">keys</div>
      <div id="reviews">reviews</div>
      <div id="partners">partners</div>
      <div id="contact">contacts</div>
    </main>
  );

}

export default Index;
